#include <fstream>
#include <bitset>

int main() {
    std::ifstream fin("cod.in");
    std::ofstream fout("cod.out");

    int n, num;
    std::bitset<100> bitset;

    fin >> n;
    for (int i = 0; i < n; ++i) {
        fin >> num;
        bitset.flip(num);
    }

    for (int i = 0; i < 100; ++i) {
        if (bitset[i]) {
            fout << i;
        }
    }

    return 0;
}
